Is fungas luachmhar é Maitake mar bhia agus mar leigheas.Le déanaí tá sé coitianta i margadh Mheiriceá agus na Seapáine mar chineál bia cúraim sláinte den scoth, agus tarraingíonn a luach cothaithe agus leighis uathúil aird níos leithne i gcónaí.Is féidir le polaisiúicríd Maitake choigeartú imdhíonachta agus incretion agus cothaithe metabolizing.Tá beacán maitake go maith freisin maidir le heipitíteas a leigheas.
Sonraíocht
Feidhm
1. Tá na héifeachtaí frith-ailse agus feabhsaithe díolúine céanna ag polaisiúicrídí beacáin maitake agus polaisiúicrídí eile cosúil le baictéir, chomh maith le cineálacha éagsúla víris heipitíteas;
2. púdar sliocht beacáin maitake uathúil bate D-glucan laghdaíonn leibhéil glúcóis fola agus tá éifeacht hypoglycemic;
3. beacáin maitake sliocht púdar aigéid shailleacha neamhsháithithe saibhir go bhfuil frith-Hipirtheannas, éifeacht hypolipidemic;mar sin tá sé saibhir i luach cothaithe agus is féidir a choimeád ar bun cothromaíocht comhlacht;
